import React, { Component } from 'react';

class Counter extends Component {
    state = {
        count:0,
        tags:['tag1','tag2','tag3']
    }

    renderTags() {
        if (this.state.tag.length === 0)
            return <p>There are no text</p>
        return(  <ul>
            <li>
                {this.state.tags.map(tag => <li key = {tag}>{tag}</li>)}
            </li>
        </ul>)
    }

    render() {


        return (
            <div>
                {this.renderTags}
            </div>
        )
    }


}

export default Counter;
